import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginP from './Pages/login'; // Corrected the component name to start with a capital letter

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/login' component={LoginP} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
